import './App.css';
import brain from './icons8-brain-96.png';


function App() {
  return (
    <div className="App">
      <div>Sign-In</div>
      <div>
        <img alt='brain logo' src={brain} width='250px' height='auto'/>
      </div>
    </div>
  );
}

export default App;
